import React from 'react';
import PropTypes from 'prop-types';
import {
    Container,
    BackgroundImage,
    Overlay,
    TextContainer,
    Title,
    LogoBox,
    Line,
    HeaderText,
} from '../styled/HeroStyles';
import backgroundImage from '../img/DaonBg.jpg';

export default function Hero({ title }) {
    return (
        <Container>
            <BackgroundImage src={backgroundImage} alt="Daon Background" />
            <Overlay />
            <TextContainer>
                <HeaderText>DaonTech</HeaderText>
                <LogoBox>
                    <Line />
                    <Title title="고객">{title}</Title>
                </LogoBox>
            </TextContainer>
        </Container>
    );
}

Hero.propTypes = {
    title: PropTypes.string.isRequired,
};
